import React from 'react'
import NavBar from './navBar'
import Home from './home'
import Settings from './settings'
import MyDataSets from './mydatasets'

function App() {
    return (
        <div className="Nav">
            <NavBar 
                pages={[Home, Settings, MyDataSets]}
            />
        </div>
    );
}

export default App;
